import React from 'react';


function Carosello(){
    return(
        <Carousel>
        <Carousel.Item interval={1000}>
            <Carousel.Caption>
            <h3>First slide label</h3>
            </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item interval={500}>
            <Carousel.Caption>
            <h3>Second slide label</h3>
            </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
            <Carousel.Caption>
            <h3>Third slide label</h3>
            </Carousel.Caption>
        </Carousel.Item>
        </Carousel>
    );
}
export default Carosello;
